import React, { useState, useEffect } from 'react';
import { onAuthStateChanged, getAuth } from 'firebase/auth';
import { NavBar } from './NavBar.js';
import { Header } from './Header.js';
import { Footer } from './Footer.js';
import { EditProfile } from './EditProfile.js';
import { SignIn } from './SignIn.js';
import { Routes, Route, Navigate } from 'react-router-dom';
import { Teams } from './Teams';
import { Dashboard } from './Home.js';
import { Compatability } from './compatability.js';
import { ProfileCard } from './ProfileCard.js';
import '../../src/index.css';



export default function App() {
    const auth = getAuth();

    function ProtectedRoute({ children }) {
    const [user, setUser] = useState(null);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const unsubscribe = onAuthStateChanged(auth, (currentUser) => {
        setUser(currentUser);
        setLoading(false);
        });

        return () => unsubscribe();
    }, []);

    if (loading) {
        return <div>Loading...</div>; // or some other loading component
    }

    return user ? children : <Navigate to="/" replace />;
    }

    const [profile, setProfile] = useState({
        name: 'Name',
        pronouns: 'Pronouns',
        mbti: 'MBTI',
        petpeeve: 'Pet Peeve',
        hobby: 'Hobby',
        favsong: 'Favorite Song',
    });

    const mbtiOption = [
        { value: "INTJ", label: "INTJ" },
        { value: "INTP", label: "INTP" },
        { value: "ENTJ", label: "ENTJ" },
        { value: "ENTP", label: "ENTP" },
        { value: "INFJ", label: "INFJ" },
        { value: "INFP", label: "INFP" },
        { value: "ENFJ", label: "ENFJ" },
        { value: "ENFP", label: "ENFP" },
        { value: "ISTJ", label: "ISTJ" },
        { value: "ISFJ", label: "ISFJ" },
        { value: "ESTJ", label: "ESTJ" },
        { value: "ESFJ", label: "ESFJ" },
        { value: "ISTP", label: "ISTP" },
        { value: "ISFP", label: "ISFP" },
        { value: "ESTP", label: "ESTP" },
        { value: "ESFP", label: "ESFP" }
    ];

    return (
        <div>
            <NavBar />
            <Header />
            <Routes>
            <Route path="/" element={<SignIn />} />
            <Route path="/editProfile" element={
                <ProtectedRoute>
                    <EditProfile profile={profile} setProfile={setProfile} mbtiOption={mbtiOption} />
                </ProtectedRoute>
            } />
            <Route path="/profile" element={
                <ProtectedRoute>
                    <ProfileCard profile={profile} />
                </ProtectedRoute>
            } />

            <Route path="/home" element={
                <ProtectedRoute>
                     <Dashboard />
                </ProtectedRoute>
            } />

            <Route path="/teams" element={
                <ProtectedRoute>
                    <Teams profile={profile} setProfile={setProfile} />
                </ProtectedRoute>
            } />

            <Route path="/compatability" element={
                <ProtectedRoute>
                    <Compatability />
                </ProtectedRoute>
            } />
        </Routes>
        <Footer />
        </div>
    );
}
